    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT - 91 BETWEEN col0 AND - 12 + + CAST ( + col1 AS INTEGER );
  - name: tab1

outputs:
  - name: q5715.out
    data: |
      51	14	96
      85	5	59
      91	47	68
